import React, { useState } from 'react';

const CreateRequest = () => {
  const [formData, setFormData] = useState({
    fname: '',
    lname: '',
    email: '',
    mob: '',
    job: '',
    ans: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your form submission logic here
    console.log(formData);
  };

  return (
    <div className="container-fluid px-1 py-5 mx-auto">
      <div className="row d-flex justify-content-center">
        <div className="col-xl-7 col-lg-8 col-md-9 col-11 text-center">
          <h3>Create Request</h3>
          {/* <p className="blue-text">Just answer a few questions<br /> so that we can personalize the right experience for you.</p> */}
          <div className="card">
            <h5 className="text-center mb-4">Powering world-class companies</h5>
            <form className="form-card" onSubmit={handleSubmit}>
              <div className="row justify-content-between text-left">
                <div className="form-group col-sm-6 flex-column d-flex">
                  <label className="form-control-label px-3">First name<span className="text-danger"> *</span></label>
                  <input type="text" name="fname" value={formData.fname} onChange={handleChange} className="form-control" placeholder="Enter your first name" />
                </div>
                <div className="form-group col-sm-6 flex-column d-flex">
                  <label className="form-control-label px-3">Last name<span className="text-danger"> *</span></label>
                  <input type="text" name="lname" value={formData.lname} onChange={handleChange} className="form-control" placeholder="Enter your last name" />
                </div>
              </div>
              <div className="row justify-content-between text-left">
                <div className="form-group col-sm-6 flex-column d-flex">
                  <label className="form-control-label px-3">Business email<span className="text-danger"> *</span></label>
                  <input type="text" name="email" value={formData.email} onChange={handleChange} className="form-control" placeholder="Enter your email" />
                </div>
                <div className="form-group col-sm-6 flex-column d-flex">
                  <label className="form-control-label px-3">Phone number<span className="text-danger"> *</span></label>
                  <input type="text" name="mob" value={formData.mob} onChange={handleChange} className="form-control" placeholder="Enter your phone number" />
                </div>
              </div>
              <div className="row justify-content-between text-left">
                <div className="form-group col-sm-6 flex-column d-flex">
                  <label className="form-control-label px-3">Job title<span className="text-danger"> *</span></label>
                  <input type="text" name="job" value={formData.job} onChange={handleChange} className="form-control" placeholder="Enter your job title" />
                </div>
              </div>
              <div className="row justify-content-between text-left">
                <div className="form-group col-12 flex-column d-flex">
                  <label className="form-control-label px-3">What would you be using Flinks for?<span className="text-danger"> *</span></label>
                  <input type="text" name="ans" value={formData.ans} onChange={handleChange} className="form-control" placeholder="Enter your answer" />
                </div>
              </div>
              <div className="row justify-content-end">
                <div className="form-group col-sm-6">
                  <button type="submit" className="btn-block btn-primary">Create Request</button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateRequest;
